CREATE DATABASE /*!32312 IF NOT EXISTS*/ jspweb /*!40100 DEFAULT CHARACTER SET utf8mb4 */;
USE jspweb;

DROP TABLE IF EXISTS bk;
CREATE TABLE `bk` (
  `bkid` int NOT NULL AUTO_INCREMENT COMMENT 'primary key',
  `bkname` varchar(20) NOT NULL,
  PRIMARY KEY (`bkid`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS pinglun;
CREATE TABLE `pinglun` (
  `pid` int NOT NULL AUTO_INCREMENT COMMENT 'primary key',
  `pl` text NOT NULL,
  `pcreate_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `tzid` int DEFAULT NULL,
  `plfs` int DEFAULT NULL,
  `bplrid` int DEFAULT NULL,
  `Uname` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`pid`)
) ENGINE=InnoDB AUTO_INCREMENT=27 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS sixin;
CREATE TABLE `sixin` (
  `sid` int NOT NULL AUTO_INCREMENT,
  `Uf` varchar(10) NOT NULL,
  `Us` varchar(10) NOT NULL,
  `neirong` text NOT NULL,
  `screate_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `record` int NOT NULL,
  PRIMARY KEY (`sid`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS tgao;
CREATE TABLE `tgao` (
  `Gid` int NOT NULL AUTO_INCREMENT COMMENT 'primary key',
  `gtitle` varchar(30) NOT NULL,
  `neirong` text,
  `gcreate_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`Gid`)
) ENGINE=InnoDB AUTO_INCREMENT=26 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS tiezi;
CREATE TABLE `tiezi` (
  `tzid` int NOT NULL AUTO_INCREMENT COMMENT 'primary key',
  `title` varchar(100) NOT NULL,
  `zhengwen` text,
  `tphoto` text,
  `zan` int DEFAULT NULL,
  `liulan` int DEFAULT NULL,
  `top` int DEFAULT NULL,
  `tcreate_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `Uid` int DEFAULT NULL,
  `bkid` int DEFAULT NULL,
  `name` varchar(10) DEFAULT NULL,
  PRIMARY KEY (`tzid`)
) ENGINE=InnoDB AUTO_INCREMENT=62 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

DROP TABLE IF EXISTS user;
CREATE TABLE `user` (
  `mid` int NOT NULL AUTO_INCREMENT COMMENT 'primary key',
  `name` varchar(10) DEFAULT NULL,
  `password` varchar(50) DEFAULT NULL,
  `type` int DEFAULT NULL,
  `email` varchar(255) DEFAULT NULL,
  `photo` varchar(255) DEFAULT NULL,
  `create_time` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`mid`)
) ENGINE=InnoDB AUTO_INCREMENT=69 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

